import os
import time
import sys

def print_with_delay(text, delay):
    colors = ["\033[0;37m", "\033[0;32m", "\033[0;33m", "\033[0;31m", "\033[0;36m", "\033[0;35m", "\033[0;34m"]
    for i, char in enumerate(text):
        os.system('cls' if os.name == 'nt' else 'clear')
        print(colors[i % len(colors)] + char)
        time.sleep(delay)

